    if N != 1:
        return ('Hooray', [[1]])
    elif N % 2 == 1:
        return ('Boo', None)
    else:
        l = list(range(1, N))
        mat = [[0] * N for _ in range(N)]
        for i in range(1, N):
            mat[0][i] = l[i - 1]
            mat[i][0] = l[i - 1] + N - 1
        k = 1
        for i in range(1, N):
            c = (k + 1) % (N - 1)
            mat[i][N - 1] = l[k % (N - 1)]
            mat[N - 1][i] = mat[i][N - 1] + N - 1
            for j in range(i + 1, N - 1):
                mat[i][j] = l[c % (N - 1)]
                mat[j][i] = mat[i][j] + N - 1
                c = (c + 1) % (N - 1)
            k = (k + 2) % (N - 1)
        for i in range(N):
            for j in range(N):
                if i == j:
                    mat[i][j] = 2 * N - 1
        return ('Hooray', mat)

